if TextTemplate.count == 0
  TextTemplate.create!([
    { introducao_1: '<p><strong>1.1 Apresentação&nbsp;</strong></p><p>A SESAI é a área do Ministério da Saúde criada em 2010 para  coordenar e executar o processo de gestão do Subsistema de Atenção à Saúde  Indígena em todo Território Nacional. Sua missão é promover a atenção à saúde  aos povos indígenas, aprimorando as ações de atenção básica e de saneamento  básico nas aldeias, observando as práticas de saúde e os saberes tradicionais,  articulando com os demais gestores do SUS para prover ações complementares e  especializadas, com controle social. </p><p>A criação da Secretaria Especial de Saúde Indígena (SESAI),  no final de 2010, representou um grande avanço na atenção à saúde indígena e  traz grandes desafios de gestão para o Ministério da Saúde. É uma Secretaria  que, diferentemente das demais Secretarias do Ministério da Saúde, executa  diretamente os serviços de atenção e prevenção à saúde, atuando nacionalmente  através de equipamentos e pessoal próprios.</p><p>Para implementar o Subsistema de Atenção à Saúde Indígena e executar  suas ações, a estrutura administrativa da SESAI conta com 3 departamentos<!--[if !supportFootnotes]-->[1] no  âmbito central e 34 Distritos Sanitários Especiais Indígenas (DSEIs), que são  as unidades gestoras descentralizadas do Subsistema, responsáveis pela execução  de ações de atenção à saúde nas aldeias, saneamento ambiental e edificações de  saúde indígena.</p><p>Os Planos Distritais de Saúde Indígena (PDSI) permitem o  planejamento da oferta de serviços de atenção à Saúde Indígena atendendo às  especificidades de cada um dos Distrito Especiais de Saúde Indígena. É um  instrumento que visa aprimorar o planejamento da gestão, buscando maior  eficiência e eficácia de suas ações.&nbsp; Os  PDSI possibilitam a integração dos planejamentos de cada Distrito ao Plano  Nacional de Saúde/ Plano Plurianual 2015-2019 e o Planejamento Estratégico da  Secretaria Especial de Saúde Indígena. </p><p>Para efetivar as ações do Subsistema de Atenção à Saúde  Indígena, de forma democrática e participativa, o Plano Distrital de Saúde  Indígena 2016-2019, previsto  na Lei nº 8.080/90, no Decreto nº 3.156/99 e na Portaria nº 3.965/2010, foi  elaborado durante o ano de 2015. &nbsp;O  presente documento além de consolidar o processo e os resultados do Plano  Distrital de Saúde Indígena de <strong>[NOME_DSEI]</strong> para o período 2016-2019,  busca dar visibilidade e transparência para a gestão da saúde indígena,  subsidiando assim o exercício de um controle social efetivo sobre a atuação do  governo. </p><p>Nessa introdução, além da apresentação, registram-se os  propósitos e princípios dos PDSI. As etapas e atividades que conformaram o  processo de construção dos PDSI são detalhadas no item 2. </p><p>Fundamental para todo exercício de planejamento é a  construção de um bom diagnóstico sobre a situação atual e a reflexão sobre os  aprendizados de exercícios de planejamento anteriores. </p><p>Nesse sentido, o item 3 do presente documento traz a  caracterização do DSEI - contemplando informações acerca das respectivas  condições socioeconômicas, epidemiológicas e de gestão do sistema. </p><p>O item 4, por sua vez, registra a análise situacional do  DSEI, construída junto ao Controle Social, com a avaliação da implementação do  PDSI referente ao período entre 2012-2015, os indicadores de saúde do Distrito  e a análise sobre os principais desafios do distrito.</p><p>Os resultados esperados para o período 2016-2019  encontram-se registrados no item 5. Complementarmente, o item 6 traz a projeção  &nbsp;orçamentária para o período.</p><p><strong>1.2 Propósitos e Princípios do PDSI</strong></p><p>Por sua importância como instrumento de planejamento, os  Planos Distritais de Saúde Indígena respondem a diversos propósitos, tanto para  a gestão dos Distritos Especiais de Saúde Indígena, como para a gestão da SESAI  Central e para o Controle Social. </p><p>No âmbito dos Distritos Especiais de Saúde Indígena, o PDSI deve  apoiar todo o ciclo do planejamento para a oferta de serviços de saúde no  âmbito distrital, a saber: (i) o diagnóstico das necessidades de saúde do  território; (ii) Apontar os resultados esperados, metas e indicadores, assim  como a projeção do orçamento quadrienal (iii)&nbsp;  definição de prioridades estratégicas para o plano de ação anual,  orientação para a execução das macro-ações (iv) Permitir o monitoramento das  ações, subsidiar a prestação de contas e a aferição de resultados. </p><p>No âmbito da SESAI Central, os PDSI devem permitir um  efetivo conhecimento das necessidades dos DSEIs contribuindo para subsidiar a  definição de prioridades estratégicas para SESAI e garantir o alinhamento entre  os instrumentos de planejamento e gestão (Plano Plurianual, Plano Estratégico  SESAI e PDSIs). Além disso, os PDSI são ferramenta essencial para que a SESAI  central cumpra seu papel no fomento da execução e monitoramento das ações,  assim como acompanhamento da execução orçamentária, base para alimentação do  Relatório Anual de Gestão (RAG).</p><p>Finalmente, no âmbito do Controle Social, na figura dos  Conselhos Distritais de Saúde Indígena, o PDSI permite o acompanhamento e  fiscalização das ações aprovadas, assim como a avaliação do impacto das mesmas sobre  a saúde dos povos indígenas. </p><p>Para  cumprir com esses propósitos, a elaboração dos Planos Distritais de Saúde  Indígena 2016-2019 deve prezar pela clareza de seus conteúdos e garantir ao alinhamento  com os demais instrumentos de planejamento do Governo Federal, assim como a  viabilidade dos resultados previstos. Além disso, devem ser construídos através  do diálogo e consulta com as populações indígenas. Esses princípios  encontram-se registrados e detalhados na figura 1.</p><p><img alt="Figura 1. Princípios para a Formulação do Plano Distrital de Saúde Indígena" class="fr-fin fr-dib" src="/images/Figura1.png" title="Figura 1. Princípios para a Formulação do Plano Distrital de Saúde Indígena" width="671"></p><p>[1]  Departamento de Gestão  da Saúde Indígena (DGESI), Departamento de Atenção à Saúde Indígena  (DASI),&nbsp; Departamento de Saneamento e  Edificações de Saúde (DSESI)</p><p><br></p><p><br></p>', created_at: '2015-10-29 22:54:13.605808', updated_at: '2015-10-30 15:42:12.899835', processo_construcao_pdsi_2: '<p>O processo de construção dos PDSI 2016-2019 foi estruturado  em três etapas: a primeira dedicou-se a atividades preparatórias de formulação  técnica e política do processo, a segunda se constituiu como o momento para a  análise situacional dos Distritos de Saúde Indígena que subsidiou a terceira  etapa, dedicada à elaboração de resultados e planejamento orçamentário, assim  como aprovação dos Planos Distritais de Saúde Indígena. Nas três etapas, o  processo previu momentos de consulta ao controle social, assim como espaço para  devolutivas do governo sobre os resultados da consulta. Nos próximos itens são  detalhados os objetivos e atividades de cada uma das etapas.</p><p>A figura 2, ao final dessa seção registra graficamente as  principais etapas do processo</p><p><br></p><p><strong>Etapa 1. Elaboração da  metodologia de construção do Plano Distrital de Saúde Indígena 2016-2019</strong></p><hr class="fr-tag"><p style="border:none;mso-border-top-alt:solid #31849B .5pt;  mso-border-top-themecolor:accent5;mso-border-top-themeshade:191;mso-border-bottom-alt:  solid #31849B .5pt;mso-border-bottom-themecolor:accent5;mso-border-bottom-themeshade:  191;padding:0cm;mso-padding-alt:1.0pt 0cm 1.0pt 0cm">O principal objetivo dessa  etapa foi promover um processo de reflexão técnica e concertação política sobre  propósitos e formatos para a elaboração dos Planos Distritais de Saúde Indígena  2016-2019.</p><hr class="fr-tag"><p>O processo de construção do PDSI 2016-2019 teve início em  junho de 2015, com a elaboração de uma proposta de metodologia por parte do  Grupo de Trabalho do PDSI (GT-PDSI), composto por todas as áreas da SESAI  Central, cinco coordenadores de DSEI e&nbsp;  um presidente de CONDISI. O GT-PDSI foi criado em maio de 2015, durante  a Oficina de Planejamento Estratégico da Saúde Indígena, que contou com a  presença de todos os coordenadores de DSEI e presidentes de CONDISI. </p><p>O GT-PDSI reuniu-se diversas vezes, totalizando quatro dias  de reuniões, para (i) avaliar avanços e dificuldades do processo de elaboração  do PDSI anterior; (ii) definir os propósitos do PDSI 2016-2019; (iii) definir  os princípios norteadores do processo de construção do PDSI 2016-2019; (iv) &nbsp;definir conteúdo e metodologia processo de  construção do PDSI 2016-2019. Durante essa primeira fase foram definidos, também, os tetos  orçamentários anualizados por DSEI.</p><p>No mês de julho de 2015, a proposta da metodologia foi  apresentada em oficina com coordenadores do DSEI, que tiveram a oportunidade de  sugerir as adaptações necessárias na proposta para que esta respondesse a  necessidade e possibilidades de todos os DSEI.&nbsp;  Entre julho e agosto de 2015 o processo de construção do PDSI 2016-2019  foi apresentado para os Conselhos Distritais de Saúde Indígena.</p><p>Ainda, em agosto de 2015 uma oficina om a participação das  equipes dos DSEI e presidentes do CONIDISI serviu como momento de formação  sobre o processo de elaboração do PDSI, incluindo não só a metodologia de construção,  mas também formação sobre critérios para a definição de tetos orçamentários e  competências da SESAI. Após essa oficina, os presidentes de CONDISI realizaram  devolutiva no âmbito de seus distritos sobre as questões trabalhadas na oficina  de formação.</p><p><br></p><p><strong>Etapa 2: Análise  Situacional dos Distritos Sanitários Especiais Indígenas</strong></p><hr class="fr-tag"><p>O principal objetivo dessa  etapa foi construir um diagnóstico compartilhado de cada território</p><hr class="fr-tag"><p>O diagnóstico consolidado de cada território se alimentou de  diversas fontes: (i) avaliação do PDSI 2012-2015; (ii) Caracterização do DSEI;  (iii) oficinas consultivas com CONDISI e Conselhos Locais para complementações  e levantamento e priorização de necessidades do território.</p><p>Para cumprir com esse objetivo, o primeiro passo foi a realização  da avaliação do PDSI 2012-2015, tanto quantitativo (comparativo entre as metas  planejadas e metas efetivamente alcançadas) como qualitativo (aprendizagens e  desafios do período). Essa avaliação for realizada primeiramente, em julho de  2015, pelas equipes dos DSEIs que se encarregaram de consolidar informações.  Nos meses de julho e agosto, essa avaliação foi compartilhada e complementada  pelos Presidente de CONDISI. &nbsp;As equipes  do DSEI e Pólos Bases se encarregaram também, entre agosto e setembro, de  levantar informações para a caracterização do DSEI, incluindo dados  demográficos, fisiográficos e do mapa de indicadores estratégicos, que servem como linha de base  para o planejamento.</p><p>A avaliação quantitativa e qualitativa do PDSI, assim como  os dados de caracterização do DSEI foram compartilhados em reuniões com os  Conselhos Locais, realizadas entre setembro e outubro. Durante essas oficinas  identificaram-se também os principais desafios e prioridades de cada  território. &nbsp;DSEI INSERIR INFORMAÇOES SOBRE  OFICINAS (QUANTIDADE DE OFICINAS REALIZADAS, PARTICIPANTES, ETC)</p><p>Os resultados dessa etapa de Análise Situacional  encontram-se registrados nos itens 3 e 4 desse documento. O item 3 traz a  caracterização do território. O item 4.1 registra a avaliação qualitativa do  PDSI 2012-2015, o item 4.2 traz os indicadores do território e o item 4.3 traz  os principais desafios do território. No anexo 1 encontram-se os resultados da  avaliação quantitativa e comparativa entre planejado e realizado no período  2012-2015.</p><p><br></p><p><strong>Etapa 3: Definição dos  Resultados Esperados e do Orçamento Macro para 2016, 2017, 2018 e 2019</strong></p><hr><p style="border:none;mso-border-top-alt:solid #31849B .5pt;  mso-border-top-themecolor:accent5;mso-border-top-themeshade:191;mso-border-bottom-alt:  solid #31849B .5pt;mso-border-bottom-themecolor:accent5;mso-border-bottom-themeshade:  191;padding:0cm;mso-padding-alt:1.0pt 0cm 1.0pt 0cm">Essa etapa buscou consolidar  todos os desafios e prioridades levantados na segunda etapa e endereçá-los  através do planejamento de resultados para o PDSI 2016-2019</p><hr class="fr-tag"><p>Em outubro, foi elaborada a primeira versão dos Resultados  Esperados e o Orçamento Macro para o período de 2016-2019 pelas equipes dos  DSEIS, com base nos insumos elaborados durante a etapa anterior e tendo como  orientador o Plano Estratégico da SESAI (ver item X). &nbsp;Essa primeira versão dos Resultados foi  enviada às áreas centrais da SESAI para que estas pudessem entre outubro e  novembro, analisar viabilidade técnica, financeira e legal das propostas.</p><p>A partir da devolutiva sobre viabilidade das propostas  elaboradas, as equipes dos DSEIS tiveram o mês de novembro para ajustar os  planos, que finalmente foram apresentados e submetidos à aprovação do Conselho  Distrital de Saúde Indígena (CONDISI) com posterior encaminhamento a Secretaria  Especial de Saúde Indígena para homologação, em ato realizado no mês de  dezembro.</p><p><br></p><p><img class="fr-fin fr-dib" alt="Figura 2 Fluxo de Elaboração dos Planos Distritais de Saúde Indígena" src="/images/Figura2.png" width="786" title="Figura 2 Fluxo de Elaboração dos Planos Distritais de Saúde Indígena"></p><p><br></p>', analise_situacional_4: '<p>A análise situacional do Distrito <strong>[NOME_DSEI]</strong> &nbsp;é o ponto de partida para o exercício de planejamento do futuro. Partir de um  bom diagnóstico compartilhado, entre gestão, trabalhadores e usuário, sobre as  especificidades do território é fundamental para entender as maiores  oportunidades e desafios que deverão nortear o planejamento para os próximos  anos. </p><p>Assim, o balanço do PDSI 2012-2015 (item 4.1) busca  registrar os avanços percebidos e as dificuldades enfrentadas pelo distrito no  período anterior. Essa análise deve contribuir com aprendizados que garantam a  aderência e a viabilidade dos resultados planejados. Os indicadores da saúde  indígena (item 4.2) permitem um diagnóstico preciso dos principais desafios  relacionados à saúde, assim como permitirão o acompanhamento da evolução das condições  de saúde no distrito. Os indicadores de saúde contribuem com informações  pertinentes que ajudam a priorização das ações mais urgentes. Considerando que  toda gestão enfrenta limites orçamentários, legais, de infraestrutura e de  recursos humanos, os indicadores proporcionam parâmetros que auxiliam na  escolha sobre como alocar esforços e recursos buscando maior efetividade das  ações.&nbsp; A partir desses dois conjunto de  informações e reflexões, o item 4.3 traz o registro dos principais desafios  para o período 2016-2019, que representam as escolhas estratégicas definidas e  debatidas junto ao controle social. </p>' },

  ])
end


